(4, 'Java 8 in Action: Lambdas', 'Raoul-Gabriel Urma', 'Java 8 in Action is a clearly written guide to the new features of Java 8. The book covers lambdas, streams, and functional-style programming. With Java 8\'s functional features you can now write more concise code in less time, and also automatically benefit from multicore architectures. It\'s time to dig in!\r\n\r\nPurchase of the print book includes a free eBook in PDF, Kindle, and ePub formats from Manning Publications.', '1617291994', , 36.72, '2014-08-24', '2023-01-04 22:52:38', 2);
