(5, 'Spring in Action: Covers Spring 4  ', 'Craig Walls ', 'Spring in Action, Fourth Edition is a hands-on guide to the Spring Framework, updated for version 4. It covers the latest features, tools, and practices including Spring MVC, REST, Security, Web Flow, and more. You\'ll move between short snippets and an ongoing example as you learn to build simple and efficient J2EE applications. Author Craig Walls has a special knack for crisp and entertaining examples that zoom in on the features and techniques you really need.\r\n\r\nPurchase of the print book includes a free eBook in PDF, Kindle, and ePub formats from Manning Publications.\r\n\r\nAbout the Technology', '161729120X', , 33.99, '2014-12-28', '2023-01-04 22:53:45', 2);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(13, 'Java Concurrency in Practice', 'Brian Goetz', '\"I was fortunate indeed to have worked with a fantastic team on the design and implementation of the concurrency features added to the Java platform in Java 5.0 and Java 6. Now this same team provides the best explanation yet of these new features, and of concurrency in general. Concurrency is no longer a subject for advanced users only. Every Java developer should read this book.\"\r\n--Martin Buchholz\r\nJDK Concurrency Czar, Sun Microsystems', '0321349601', , 28.79, '2006-05-19', '2023-01-05 00:12:34', 1);

